/**
 * @param {string} colors
 * @return {boolean}
 */
var winnerOfGame = function (colors) {
  let alice_turn = true;

  while (colors) {
    // console.log(colors);
    //make move
    colors = makeMove(colors, alice_turn);
    alice_turn = !alice_turn;
  }
  return alice_turn; //bob has to move and there is no valid move.
};

function makeMove(colors, aliceTurn) {
  const idx = colors.indexOf(aliceTurn ? "AAA" : "BBB");
  if (idx >= 0) {
    return strSplice(colors, idx + 1, 1);
  }
  return null;
}

function strSplice(str, idx, len) {
  let newStr = str.split(""); // or newStr = [...str];
  newStr.splice(idx, 1);
  return newStr.join("");
}

function checkWinner(colors) {
  let AliceMoves = 0;
  let BobsMoves = 0;
  let islandLen = 0;
  let lastItemColor;
  for (var i in colors) {
    if (Number(i) > 0) {
      if (colors[i] != lastItemColor || Number(i) == colors.length - 1) {
        if(colors[i] == lastItemColor &&  Number(i) == colors.length - 1){
					islandLen++;
				}

        const moveIncrement = islandLen > 2 ? islandLen - 2 : 0;
        // console.log(lastItemColor, islandLen);
        lastItemColor === "A"
          ? (AliceMoves += moveIncrement)
          : (BobsMoves += moveIncrement);

        // console.log(moveIncrement, islandLen);
        islandLen = 1;
      } else {
        islandLen++;
      }
    } else {
      islandLen = 1;
    }
    // console.log(i, islandLen, colors[i], lastItemColor);
    lastItemColor = colors[i];
  }
  // console.log(AliceMoves, BobsMoves);
  return AliceMoves > BobsMoves;
}

